Edge Fillet

**Description:** Rounded edge using difference with cylinder.

**Example:**
```openscad
eps = 0.01;
$fn = 50;

difference() {
    cube([20, 20, 10]);

    // Fillet on one edge
    translate([0, 0, 10])
        rotate([0, 90, 0])
            cylinder(h=20, r=2);
}
```

Corner Fillet

**Description:** Rounded corner using difference with sphere.

**Example:**
```openscad
eps = 0.01;
$fn = 50;

difference() {
    cube([20, 20, 10]);

    // Fillet on corner
    translate([0, 0, 10])
        sphere(r=3);
}
```

---

Edge Chamfer

**Description:** Angled edge cut.

**Example:**
```openscad
eps = 0.01;

difference() {
    cube([20, 20, 10]);

    // 45-degree chamfer
    translate([-eps, -eps, 10])
        rotate([0, 45, 0])
            cube([3, 22, 3]);
}
```

Corner Chamfer

**Description:** Cut corner at angle.

**Example:**
```openscad
eps = 0.01;

difference() {
    cube([20, 20, 10]);

    // Corner chamfer
    translate([20, 20, 10])
        rotate([0, 0, 45])
            cube([5, 5, 5], center=true);
}
```

