Linear Array

**Description:** Repeat objects in a line.

**Example:**
```openscad
$fn = 30;

for(i = [0:4]) {
    translate([i*15, 0, 0])
        cylinder(h=10, r=3);
}
```

Grid Pattern

**Description:** 2D array of objects.

**Example:**
```openscad
$fn = 30;

for(x = [0:4]) {
    for(y = [0:4]) {
        translate([x*10, y*10, 0])
            cylinder(h=5, r=2);
    }
}
```

Circular Pattern

**Description:** Objects arranged in a circle.

**Example:**
```openscad
$fn = 30;
count = 12;

for(i = [0:count-1]) {
    rotate([0, 0, i*(360/count)])
        translate([20, 0, 0])
            cube([3, 3, 10], center=true);
}
```

