Multiple Differences

**Example:**
```openscad
eps = 0.01;
$fn = 50;

difference() {
    cube([30, 30, 10], center=true);

    // Multiple holes
    translate([-8, -8, -eps]) cylinder(h=10+2*eps, r=2);
    translate([8, -8, -eps]) cylinder(h=10+2*eps, r=2);
    translate([-8, 8, -eps]) cylinder(h=10+2*eps, r=2);
    translate([8, 8, -eps]) cylinder(h=10+2*eps, r=2);
}
```

Intersection

**Description:** Keep only overlapping parts.

**Example:**
```openscad
$fn = 50;

intersection() {
    cube([20, 20, 20], center=true);
    sphere(r=12);
}
// Creates rounded cube
```

