// Countersunk Hole Example
// Hole with angled top for flat-head screws

eps = 0.01;
$fn = 50;

difference() {
    cube([20, 20, 10], center=true);

    // Main hole (shaft)
    translate([0, 0, -eps])
        cylinder(h=10+2*eps, r=2);

    // Countersink (cone for screw head)
    translate([0, 0, 5-eps])
        cylinder(h=3, r1=2, r2=4);
}

// Mounting Plate with 4 Corner Holes
// Common pattern for mounting brackets

eps = 0.01;
$fn = 50;

module mounting_plate(width, height, thickness, hole_diameter, hole_inset) {
    difference() {
        // Main plate
        cube([width, height, thickness], center=true);

        // 4 corner holes
        for(x = [-(width/2-hole_inset), (width/2-hole_inset)]) {
            for(y = [-(height/2-hole_inset), (height/2-hole_inset)]) {
                translate([x, y, -eps])
                    cylinder(h=thickness+2*eps, d=hole_diameter);
            }
        }
    }
}

// Example usage
mounting_plate(50, 50, 5, 4, 5);

// Through Hole Example
// A hole that goes completely through an object

eps = 0.01;
$fn = 50;

difference() {
    // Main body
    cube([20, 20, 10], center=true);

    // Through hole
    translate([0, 0, -eps])
        cylinder(h=10+2*eps, r=2);
}

// Circular Pattern
// Objects arranged in a circle

$fn = 30;
count = 12;
radius = 20;

for(i = [0:count-1]) {
    angle = i * (360/count);
    rotate([0, 0, angle])
        translate([radius, 0, 0])
            cube([3, 3, 10], center=true);
}

// Grid Pattern
// 2D array of objects

$fn = 30;
rows = 5;
cols = 5;
spacing = 10;

for(x = [0:cols-1]) {
    for(y = [0:rows-1]) {
        translate([x*spacing, y*spacing, 0])
            cylinder(h=5, r=2);
    }
}

// Linear Pattern of Cylinders
// Repeat objects in a line using for loop

$fn = 30;
count = 5;
spacing = 15;

for(i = [0:count-1]) {
    translate([i*spacing, 0, 0])
        cylinder(h=10, r=3);
}

// Rounded Box using Hull Method
// Creates box with rounded vertical edges

$fn = 30;
r = 2;  // Corner radius
width = 20;
height = 20;
depth = 10;

hull() {
    // Place cylinders at each corner
    translate([r, r, 0])
        cylinder(r=r, h=depth);
    translate([width-r, r, 0])
        cylinder(r=r, h=depth);
    translate([r, height-r, 0])
        cylinder(r=r, h=depth);
    translate([width-r, height-r, 0])
        cylinder(r=r, h=depth);
}

// Rounded Corners using Minkowski + Sphere
// Best method for uniform rounding of all edges

$fn = 30;
r = 2;  // Rounding radius

minkowski() {
    // Original shape (reduced by 2*r in each dimension)
    cube([16, 16, 6], center=true);

    // Rounding sphere
    sphere(r=r);
}

// Result: 20x20x10 cube with all edges rounded
// Final size = original + 2*r in each dimension
